import React from 'react';
import axios from 'axios'

function App() {
  const url = 'https://api.openweathermap.org/data/2.5/weather?lat=44.34&lon=10.99&appid=38444bd806c43f5e16da1714f978e46e'
  return (
    <div className='App'>
        <div className='text-center p-4'>
          <div className='w-full h-full relative'>
            <input 
                type='text' 
                className="py-3 px-6 w-[700px] text-lg rounded-3x1 border
                border-gray-200 text-gray-600 placeholder:text-gray-400 focus:outline-none
                bg-white-600/100 shadow-md"
                placeholder="Enter location"
              />
            </div>
        </div>
    </div>
  );
}

export default App;
